import React from "react";
import SEO from "../../../common/SEO";
import Header from "../../Header/Header";
import Footer from "../../Footer/Footer";
import About from "./About";
import Subs from "../../Subscriptions/Subs";
import Separator from "../../../components/separator/Separator";

const IhelpPlus = () => {
  return (
    <>
      <SEO title="IhelpPlus" />
      <main className="page-wrapper">
        <Header btnStyle="btn-small" HeaderSTyle="header-not-transparent" />

        {/* Start Slider Area  */}
        <div className="slider-area slider-style-3 height-850">
          <div className="container">
            <div className="row row--30 align-items-center">
              <div className="order-2 order-lg-1 col-lg-7 mt_md--50 mt_sm--50 mt_lg--30">
                <div className="inner text-left">
                  <h1 className="title theme-gradient">ihelp+</h1>
                  <p className="description">
                    Монголын медиа зах зээлд хувь
                    хүн болон карьер хөгжлийн чиглэлээр анхлан нэвтрүүлж буй сэтгүүл. 
                  </p>
                </div>
              </div>
              <div className="order-1 order-lg-2 col-lg-5">
                <div className="thumbnail">
                  <img
                    src="./images/ihelplogo/plusW1.png"
                    alt="Banner Images"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
        {/* End Slider Area  */}

        <Separator />
        <About />
        <Separator />
        <Subs />
        <Separator />
        <Footer />
      </main>
    </>
  );
};
export default IhelpPlus;
